          </p>
          <div className="demo-credentials">
            <h4>üë®‚Äçüíª –î–µ–º–æ –¥–æ—Å—Ç—É–ø:</h4>
            <p><strong>–õ–æ–≥–∏–Ω:</strong> admin</p>
            <p><strong>–ü–∞—Ä–æ–ª—å:</strong> admin123</p>
          </div>
        </div>
